import { NextApiRequest, NextApiResponse } from 'next'
import { Note } from '../../logic/colllections/note'

export default async (req: NextApiRequest, res: NextApiResponse) => {
  const notes = (await Note.find())
    .map((note) => note.text)
    .reduce((t1, t2) => `${t1},${t2}`)
  res.status(200).json({ notes })
}
